      "content": "//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

interface IERC20 {
    function balanceOf(address account) external view returns (uint256);

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) external returns (bool);

    function allowance(address owner, address spender)
        external
        view
        returns (uint256);
}

contract Payer is AccessControlEnumerable, Pausable {
    bytes32 public constant MANAGER_ROLE = keccak256("MANAGER_ROLE");

    address public treasury;

    mapping(address => mapping(address => uint256)) public availableAmount;
    mapping(bytes32 => bool) public paid;

    constructor(address _treasury, address _admin) {
        treasury = _treasury;
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(MANAGER_ROLE, _admin);
    }

    event CommissionsAdded(
        address[] addresses,
        uint256[] amounts,
        address token,
        bytes32[] paymentIds
    );

    event Withdraw(address to, address token, uint256 amount);

    function pause() public onlyRole(MANAGER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(MANAGER_ROLE) {
        _unpause();
    }

    function setCommission(
        address _user,
        address _token,
        uint256 _amount
    ) public onlyRole(MANAGER_ROLE) {
        require(_user != address(0), "seting to address 0");
        availableAmount[_user][_token] = _amount;
    }

    function addCommissions(
        address[] memory _users,
        uint256[] memory _amounts,
        bytes32[] memory _paymentIds,
        address _token
    ) public onlyRole(MANAGER_ROLE) whenNotPaused {
        require(_users.length == _amounts.length, "bad array sizes");
        require(_users.length == _paymentIds.length, "bad array sizes");

        for (uint32 i; i < _users.length; i++) {
            _addCommission(_users[i], _amounts[i], _paymentIds[i], _token);
        }

        emit CommissionsAdded(_users, _amounts, _token, _paymentIds);
    }

    function _addCommission(
        address _user,
        uint256 _amount,
        bytes32 _paymentId,
        address _token
    ) private {
        require(!paid[_paymentId], "already paid");
        availableAmount[_user][_token] += _amount;
        paid[_paymentId] = true;
    }

    function withdraw(address _token, uint256 _amount) public whenNotPaused {
        require(
            _amount <= availableAmount[msg.sender][_token],
            "withdraw amount is to high"
        );
        require(
            IERC20(_token).balanceOf(treasury) >= _amount,
            "not enough in treasury balance"
        );
        availableAmount[msg.sender][_token] -= _amount;
        IERC20(_token).transferFrom(treasury, msg.sender, _amount);

        emit Withdraw(msg.sender, _token, _amount);
    }
}
"
